import { MeshBasicMaterial, Vector3, Mesh, BoxGeometry } from "three";


function CreateBaseCube(){
    return new Mesh( new BoxGeometry(5,5), new MeshBasicMaterial({color:'white'}))
}


export {CreateBaseCube}
